import React from 'react'

function Tarjeta({reyes}) {
const resultado = reyes.filter(e=> e.vacasComidas >= 10 && e.reinado > 10);

    return (
    <div>
     {resultado == undefined ? "No se ha podido encontrar"
     : resultado.nombre} 
    </div>
  );
}

export default Tarjeta
